import { get, post, postForm } from '~/utils/fetch';
export default {
  fetch_downloadTemplate_list: params => {
    return get(`/core/rural/downloadTemplate`, params);
  },
  fetch_uploadRecord_list: params => {
    return get(`/core/rural/getUploadRecord`, params);
  },
  fetch_upload_list: params => {
    return post(`/core/rural/upload`, params);
  },
  fetch_rescore_list: params => {
    return postForm(`/core/rural/rescore`, params);
  }
};
